import React, { useEffect, useState } from 'react'
import axios from "axios";
const UseEffectHook = () => {
    const [data, setdata] = useState("");
    useEffect(() => {
        axios.get("https://jsonplaceholder.typicode.com/posts")
            .then((res) => {
                setdata(res.data);
            })
    }, [])
    return (
        <div>
            {/* {console.log(data)} */}
            {data.map((data) => (
                <div>
                   {data.u} {data.title}
                </div>
            ))}

            {/* data.map(data => (
            <div>
                {data.title}

            </div>
            )) */}
        </div>
    )
}

export default UseEffectHook;
